Details.Description:
Galpão, A.T. 17.157m², A.C. 1.245m² 
Imóvel objeto da matrícula nº 13.973 do Cartório de Registro de Imóveis de São Joao da Boa Vista.

&nbsp;


Matrícula:
&nbsp;Imóvel: - TERRENO com frente para a rua Cesário Travassos com a área exata de 17.157 metros quadrados, ou 1h, 71ª, e 57e, ou ainda 0,625 alqueires mais 2.032 metros quadrados com a seguinte demarcação e características: - ''Tem princípio no marco 0 (zero), colocado junto a ponte sobre o rio Jaguary e rua Cesário Travassos; daí seguindo pela rua Cesário Travassos acima, com cento e um metros, vae ao marco 1, esquina com a rua Cel. Domingos Teodoro; deste, volta à esquerda e pela rua Cel. Domingos Theodoro, com cento e vinte e quatro metros e cinquenta centímetros, vae ao marco 2, em divisas com terras de sucessores de Samuel Ferreira; deste, volta à esquerda, azimute rumo 191º, com quarenta e sete metros, vae ao marco 3, junto à margem esquerda do rio Jaguary, divide até aqui com terras dos sucessores de Samuel Ferreira; daí volta a esquerda e pelo rio Jaguary abaixo, azimute rumo médio 60º com 180 metros, vae ao marco zero (0) onde teve princípio e fim desta demarcação, dividindo neste trecho com o rio Jaguary, existindo neste terreno as seguintes benfeitorias: - O prédio para a fábrica de tecidos com frente para a rua Cesário Travassos esquina da rua Domingos Teodoro, e mais sete prédios nas ruas Cesário Travassos nº 27 e fundos; nº 47 e fundos; Domingos Teodoro nº 79, Prédios de dois pavimentos: térreo e 1º andar, com depósito, loja e sanitários; prédio onde funciona a fábrica, constante de andar inferior: - Departamento pessoal, tinturaria e centrífuga; entrada da fábrica, escritório geral, W.C., vestiário das mulheres. Andar superior: - Diretoria, contabilidade, arquivo, tesouraria, salão com balcão e guichê para atendimento ao público, sala de espera; aumento de uma cabine para transformador que dá para a rua Domingos Teodoro.'' Av.41/13.973 (SERVIDÃO) A presente servidão destina-se a implantação do Coletor Tronco CT III - Cadastro: 1005/344, parte integrante do Sistema de Esgotos Sanitários de São João da Boa Vista, sobre uma área de 493,45m².

&nbsp;


Conforme informações constantes do laudo de avaliação de fls. 1.602/1.611:
&nbsp;DAS PECULIARIDADES DO IMÓVEL: O imóvel encontra-se em regular estado de conservação no geral, possuindo edificações em mau estado, e outras em bom estado. Possui área total de 17.157,00 metros quadrados de terreno, 1.245,20 metros quadrados de edificações, e área total de 6.599,94 metros quadrados dos barracões. A construção data de 1.943, apesar de haver sido reformada posteriormente, adequando-se à sua situação e atividade empresarial atual, sendo certo que a última reforma data de janeiro de 2.010, conforme informações cadastrais fornecidas pela Prefeitura Municipal local. Localiza-se em região central provida de todos os melhoramentos públicos necessários, inclusive rua asfaltada, margeando o Rio Jaguari Mirim.

